import React, { useState } from 'react';
import {
  Container,
  Paper,
  TextField,
  Button,
  Typography,
  Stepper,
  Step,
  StepLabel,
  Box,
  Alert
} from '@mui/material';
import { useNavigate } from 'react-router-dom';

const ProfileSetup = () => {
  const [activeStep, setActiveStep] = useState(0);
  const [error, setError] = useState('');
  const navigate = useNavigate();

  const [companyProfile, setCompanyProfile] = useState({
    name: '',
    registrationNumber: '',
    taxId: '',
    address: '',
    phoneNumber: '',
    email: ''
  });

  const [bankProfile, setBankProfile] = useState({
    bankName: '',
    accountNumber: '',
    branchCode: '',
    swiftCode: ''
  });

  const handleCompanySubmit = async () => {
    try {
      const response = await fetch('http://localhost:5000/api/profile/company', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': `Bearer ${localStorage.getItem('token')}`
        },
        body: JSON.stringify(companyProfile),
      });

      const data = await response.json();

      if (!response.ok) {
        throw new Error(data.message || 'Failed to save company profile');
      }

      setActiveStep(1);
    } catch (err) {
      console.error('Company profile error:', err);
      setError(err.message || 'An error occurred while saving company profile');
    }
  };

  const handleBankSubmit = async () => {
    try {
      const response = await fetch('http://localhost:5000/api/profile/bank', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': `Bearer ${localStorage.getItem('token')}`
        },
        body: JSON.stringify(bankProfile),
      });

      const data = await response.json();

      if (!response.ok) {
        throw new Error(data.message || 'Failed to save bank profile');
      }

      navigate('/dashboard');
    } catch (err) {
      console.error('Bank profile error:', err);
      setError(err.message || 'An error occurred while saving bank profile');
    }
  };

  const steps = ['Company Information', 'Bank Information'];

  const renderStepContent = (step) => {
    switch (step) {
      case 0:
        return (
          <Box component="form" sx={{ mt: 2 }}>
            <TextField
              fullWidth
              label="Company Name"
              margin="normal"
              required
              value={companyProfile.name}
              onChange={(e) => setCompanyProfile({ ...companyProfile, name: e.target.value })}
            />
            <TextField
              fullWidth
              label="Registration Number"
              margin="normal"
              required
              value={companyProfile.registrationNumber}
              onChange={(e) => setCompanyProfile({ ...companyProfile, registrationNumber: e.target.value })}
            />
            <TextField
              fullWidth
              label="Tax ID"
              margin="normal"
              required
              value={companyProfile.taxId}
              onChange={(e) => setCompanyProfile({ ...companyProfile, taxId: e.target.value })}
            />
            <TextField
              fullWidth
              label="Address"
              margin="normal"
              required
              multiline
              rows={3}
              value={companyProfile.address}
              onChange={(e) => setCompanyProfile({ ...companyProfile, address: e.target.value })}
            />
            <TextField
              fullWidth
              label="Phone Number"
              margin="normal"
              required
              value={companyProfile.phoneNumber}
              onChange={(e) => setCompanyProfile({ ...companyProfile, phoneNumber: e.target.value })}
            />
            <TextField
              fullWidth
              label="Email"
              type="email"
              margin="normal"
              required
              value={companyProfile.email}
              onChange={(e) => setCompanyProfile({ ...companyProfile, email: e.target.value })}
            />
            <Button
              fullWidth
              variant="contained"
              color="primary"
              sx={{ mt: 3 }}
              onClick={handleCompanySubmit}
            >
              Next
            </Button>
          </Box>
        );
      case 1:
        return (
          <Box component="form" sx={{ mt: 2 }}>
            <TextField
              fullWidth
              label="Bank Name"
              margin="normal"
              required
              value={bankProfile.bankName}
              onChange={(e) => setBankProfile({ ...bankProfile, bankName: e.target.value })}
            />
            <TextField
              fullWidth
              label="Account Number"
              margin="normal"
              required
              value={bankProfile.accountNumber}
              onChange={(e) => setBankProfile({ ...bankProfile, accountNumber: e.target.value })}
            />
            <TextField
              fullWidth
              label="Branch Code"
              margin="normal"
              required
              value={bankProfile.branchCode}
              onChange={(e) => setBankProfile({ ...bankProfile, branchCode: e.target.value })}
            />
            <TextField
              fullWidth
              label="SWIFT Code"
              margin="normal"
              required
              value={bankProfile.swiftCode}
              onChange={(e) => setBankProfile({ ...bankProfile, swiftCode: e.target.value })}
            />
            <Button
              fullWidth
              variant="contained"
              color="primary"
              sx={{ mt: 3 }}
              onClick={handleBankSubmit}
            >
              Complete Setup
            </Button>
          </Box>
        );
      default:
        return null;
    }
  };

  return (
    <Container maxWidth="md">
      <Paper elevation={3} sx={{ p: 4, mt: 8 }}>
        <Typography variant="h4" align="center" gutterBottom>
          Profile Setup
        </Typography>
        {error && <Alert severity="error" sx={{ mb: 2 }}>{error}</Alert>}
        <Stepper activeStep={activeStep} sx={{ mb: 4 }}>
          {steps.map((label) => (
            <Step key={label}>
              <StepLabel>{label}</StepLabel>
            </Step>
          ))}
        </Stepper>
        {renderStepContent(activeStep)}
      </Paper>
    </Container>
  );
};

export default ProfileSetup;
